function [u,t,counter]=pc19(f,t0,y0,tf,tol,maxord)
%   Solve non-stiff differential equations, variable order-variable step method.
%   
%   [UOUT,TOUT,COUNTER]=pc19(ODEFUN,T0,Y0,TFINAL,TOL) integrates the system of
%   differential equations y'=f(t,y) from time T0 to TFINAL with initial
%   conditions Y0 and an error tolerance TOL. ODEFUN is a function handle. 
%   For a scalar T and vector Y, ODEFUN(T,Y) must return a column vector 
%   corresponding to f(t,y). Each row in UOUT corresponds to a time 
%   returned in the column vector TOUT. Each column in UOUT corresponds 
%   to a solution of one differential equation in the system f(t,y).
%   COUNTER specifies the number of function evaluations.
%
%   [UOUT,TOUT]=pc19(ODEFUN,T0,Y0,TFINAL,TOL,MAXORD) solves as above but
%   limits the maximum order of the method to MAXORD. By default,
%   MAXORD=9.
%   
%   This function utilizes an adaptive-step scheme based on Adams-Bashforth
%   and Adams-Moulten methods for a predictor-corrector strategy. The
%   initial step utilizes Heun's Method. The proceeding kth step utilizes a
%   kth order method, beginning at 2nd order and maximizing at 9th order by
%   default. In the case MAXORD is inputted, the order maximizes at MAXORD.
%   In either case, the order remains at MAXORD (9) until TFINAL is
%   reached.
%

if nargin<6
    maxord=9;
end
% INITALIZATION
t(1)=t0;
u=y0;
H=(tf-t0)/100; % Choose an initial step size
tol1=tol/(tf-t0); % Bound on the LTE (error committed on one step)
etarg=tol1/2; % Target error per step is within half of tol1.
counter=0;
[u,t,km,counter]=OneStep(f,u,t,tol1,H,counter); % Take first step with Heun's Method
H=t(2)-t(1); % Get latest H

% MAIN ITERATION:
hmin=min(tol/100,1e-6);
j=2;
goodstep=true;
while t(j)<tf && H>hmin
    % Get the parameters of the algorithm, based on the current and
    % previous step sizes (H, h(1), ... , h(k-1) respectively):
    ord=min(j,maxord); % Order increases with each step up until maxord
    h=getSteps(ord,t,j); % Get step sizes
    [pbeta,cbeta,err]=getParams(ord,h,H); % Get parameters
    if goodstep
        km(:,ord)=f(t(j),u(:,j)); % Compute most recent slope
        counter=counter+1;
    end
    u1=u(:,j)+km*pbeta; % Compute Predictor
    slp=[km(:,2:ord),f(t(j)+H,u1)]; % Shift slopes to insert implicit slope.
    counter=counter+1;
    u2=u(:,j)+slp*cbeta; % Compute Corrector
    plte=err(2)*(u2-u1)/(H*(err(1)-err(2))); % Estimate PLTE
    % Decide how to proceed (step-size cannot change by a factor > 10):
    if norm(plte)>tol1
        % Reject this step, reduce H, and try again:
        goodstep=false;
        ht=estimateNextH(err,ord,u1,u2,etarg,h);
        H=max(ht,0.1*H);
        
    else
        % Accept step
        goodstep=true;
        t(j+1)=t(j)+H; % Take step forward
        u(:,j+1)=u2+H*plte; % Local Extrapolation
        j=j+1;
        h=getSteps(ord,t,j);
        ht=min(estimateNextH(err,ord,u1,u2,etarg,h),tf-t(j));
        if ht>10*H
            H=10*H;
        elseif ht<0.1*H
            H=0.1*H;
        else
            H=ht;
        end
        if t(j)<tf && ord==maxord % Shift arrays to accomdate next step
            km=km(:,2:ord);
        end
    end
    %fprintf('t=%.8e, h=%.4e\n',t(j),H);
    if H<=hmin && tf-t(j)>H
        fprintf('Minimum step size reached; integration terminated.\n')
    end 
end
t=t';
u=u';
end

% SUBROUTINES

% Use Heun's Method to take first step
function [u,t,km,counter]=OneStep(f,u,t,tol1,H,counter)
done=0;
l=0;
maxitn=100;
while ~done
   % Compute the slopes:
   if l==0
       k1=f(t(1),u(:,1));
       counter=counter+1;
   end
   k2=f(t(1)+H,u(:,1)+H*k1);
   counter=counter+1;
   % Compute the first-order estimate:
   u1=u(:,1)+H*k1;
   % Compute the second-order estimate:
   u2=u(:,1)+H*(0.5*k1+0.5*k2);
   % Estimate the local truncation error:
   lte=norm(u2-u1);
   % Decide how to proceed:
   l=l+1;
   if lte>=tol1 && l<maxitn
      % Reject this step, reduce h, and try again:
       H=H*sqrt(tol1/(2*lte));
   elseif l==maxitn
      error('Maximum number of step-size reductions reached in initialization.')
   else
      % Accept this step:
      t(2)=t(1)+H;
      u(:,2)=u2;
      km(:,1)=k1;
      done=1;
   end
end
end

% getSteps() returns a 1x(k-1) array of h values at the increment j
function h=getSteps(ord,t,j)
    for m=1:(ord-1)
        h(m)=t(j-(m-1))-t(j-m); % Take step size between each t(j) and t(j-1)
    end
end

% getParams() returns an array of beta and LTE coefficients for the 
% predictor and corrector
function [pbeta,cbeta,err]=getParams(ord,h,H)
% H = t(j+1)-t(j)
% h(i)=t(j-i+1)-t(j-i)
% pbeta = AB(k) predictor beta coefficients
% cbeta = AM(k-1) corrector beta coefficients
% err(1)=predictor plte, err(2)=corrector plte
    if ord==2
        pbeta=[
        -H*H/(2*h(1))
        H+H^2/(2*h(1))
        ];
        
        cbeta=[
        0.5*H
        0.5*H
        ];
        
        err=[
        1/12*H^2*(2*H+3*h(1))
        -1/12*H^3
        ];
     
    elseif ord==3
        pbeta=[
        (H^2*(2*H+3*h(1)))/(6*h(2)*(h(1)+h(2)))

        -((H^2*(2*H+3*(h(1)+h(2))))/(6*h(1)*h(2)))

        (H*(2*H^2+6*h(1)*(h(1)+h(2))+3*H*(2*h(1)+h(2))))/(6*h(1)*(h(1)+h(2)))
        ];
        
        cbeta=[
        H^3/(6*(-H-h(1))*h(1))

        H/2+H^2/(6*h(1))

        H^2/(3*(H+h(1)))+(H*h(1))/(2*(H+h(1)))
        ];

        err=[
        (1/72)*H^2*(3*H^2+6*h(1)*(h(1)+h(2))+4*H*(2*h(1)+h(2)))

        (-(1/72))*H^3*(H+2*h(1))
        ];
    
    elseif ord==4

        pbeta=[
        -((H^2*(3*H^2+6*h(1)*(h(1)+h(2))+4*H*(2*h(1)+h(2))))/(12*h(3)*(h(2)+h(3))*(h(1)+h(2)+h(3))))

        (H^2*(3*H^2+6*h(1)*(h(1)+h(2)+h(3))+4*H*(2*h(1)+h(2)+h(3))))/(12*h(2)*(h(1)+h(2))*h(3))

        -((H^2*(3*H^2+6*(h(1)+h(2))*(h(1)+h(2)+h(3))+4*H*(2*h(1)+2*h(2)+h(3))))/(12*h(1)*h(2)*(h(2)+h(3))))
        
        (H*(3*H^3+12*h(1)*(h(1)+h(2))*(h(1)+h(2)+h(3))+4*H^2*(3*h(1)+2*h(2)+h(3))+6*H*(3*h(1)^2+h(2)*(h(2)+h(3))+2*h(1)*(2*h(2)+h(3)))))/(12*h(1)*(h(1)+h(2))*(h(1)+h(2)+h(3)))
        ];

        cbeta=[
        (H^3*(H+2*h(1)))/(12*h(2)*(h(1)+h(2))*(H+h(1)+h(2)))

        -((H^3*(H+2*(h(1)+h(2))))/(12*h(1)*(H+h(1))*h(2)))

        (H*(H^2+6*h(1)*(h(1)+h(2))+2*H*(2*h(1)+h(2))))/(12*h(1)*(h(1)+h(2)))

        (H*(3*H^2+6*h(1)*(h(1)+h(2))+4*H*(2*h(1)+h(2))))/(12*(H+h(1))*(H+h(1)+h(2)))
        ];

        err=[
        (1/1440)*(H^2*(12*H^3+30*h(1)*(h(1)+h(2))*(h(1)+h(2)+h(3))+15*H^2*(3*h(1)+2*h(2)+h(3))+20*H*(3*h(1)^2+h(2)*(h(2)+h(3))+2*h(1)*(2*h(2)+h(3)))))
        -((H^3*(3*H^2+10*h(1)*(h(1)+h(2))+5*H*(2*h(1)+h(2))))/1440)
        ];
        
    elseif ord==5

        pbeta=[
        (H^2*(12*H^3+30*h(1)*(h(1)+h(2))*(h(1)+h(2)+h(3))+ ...
        15*H^2*(3*h(1)+2*h(2)+h(3))+20*H*(3*h(1)^2+h(2)*(h(2)+h(3))+ ...
        2*h(1)*(2*h(2)+h(3)))))/(60*h(4)*(h(3)+h(4))*(h(2)+h(3)+h(4))* ...
        (h(1)+h(2)+h(3)+h(4)))
        
        -((H^2*(12*H^3+30*h(1)*(h(1)+h(2))*(h(1)+h(2)+h(3)+h(4))+ ...
        15*H^2*(3*h(1)+2*h(2)+h(3)+h(4))+ ...
        20*H*(3*h(1)^2+h(2)*(h(2)+h(3)+h(4))+2*h(1)*(2*h(2)+h(3)+h(4)))))/ ...
        (60*h(3)*(h(2)+h(3))*(h(1)+h(2)+h(3))*h(4))) 

        (H^2*(12*H^3+30*h(1)*(h(1)+h(2)+h(3))*(h(1)+h(2)+h(3)+h(4))+ ...
        15*H^2*(3*h(1)+2*h(2)+2*h(3)+h(4))+ ...
        20*H*(3*h(1)^2+(h(2)+h(3))*(h(2)+h(3)+h(4))+ ...
        2*h(1)*(2*h(2)+2*h(3)+h(4)))))/(60*h(2)*(h(1)+h(2))*h(3)*(h(3)+h(4)))
        
        -((H^2*(12*H^3+30*(h(1)+h(2))*(h(1)+h(2)+h(3))*...
        (h(1)+h(2)+h(3)+h(4))+15*H^2*(3*h(1)+3*h(2)+2*h(3)+h(4))+...
        20*H*(3*h(1)^2+3*h(2)^2+h(3)*(h(3)+h(4))+2*h(2)*(2*h(3)+h(4))+...
        2*h(1)*(3*h(2)+2*h(3)+h(4)))))/(60*h(1)*h(2)*(h(2)+h(3))*...
        (h(2)+h(3)+h(4))))
        
        ((1/5)*H^5+H*h(1)*(h(1)+h(2))*(h(1)+h(2)+h(3))* ...
        (h(1)+h(2)+h(3)+h(4))+(1/4)*H^4*(4*h(1)+3*h(2)+2*h(3)+h(4))+ ...
        (1/3)*H^3*(6*h(1)^2+3*h(2)^2+h(3)*(h(3)+h(4))+2*h(2)*(2*h(3)+h(4))+ ...
        3*h(1)*(3*h(2)+2*h(3)+h(4)))+(1/2)*H^2* ...
        (4*h(1)^3+h(2)*(h(2)+h(3))*(h(2)+h(3)+h(4))+ ...
        3*h(1)^2*(3*h(2)+2*h(3)+h(4))+2*h(1)*(3*h(2)^2+h(3)*(h(3)+h(4))+ ...
        2*h(2)*(2*h(3)+h(4)))))/(h(1)*(h(1)+h(2))*(h(1)+h(2)+h(3))* ...
        (h(1)+h(2)+h(3)+h(4)))

        ];

        cbeta=[

        -((H^3*(3*H^2+10*h(1)*(h(1)+h(2))+5*H*(2*h(1)+h(2))))/ ...
        (60*h(3)*(h(2)+h(3))*(h(1)+h(2)+h(3))*(H+h(1)+h(2)+h(3))))
        
        (H^3*(3*H^2+10*h(1)*(h(1)+h(2)+h(3))+5*H*(2*h(1)+h(2)+h(3))))/ ...
        (60*h(2)*(h(1)+h(2))*(H+h(1)+h(2))*h(3))
        
        -((H^3*(3*H^2+10*(h(1)+h(2))*(h(1)+h(2)+h(3))+ ...
        5*H*(2*h(1)+2*h(2)+h(3))))/(60*h(1)*(H+h(1))*h(2)*(h(2)+h(3))))
        
        (H*(3*H^3+30*h(1)*(h(1)+h(2))*(h(1)+h(2)+h(3))+ ...
        5*H^2*(3*h(1)+2*h(2)+h(3))+10*H*(3*h(1)^2+h(2)*(h(2)+h(3))+ ...
        2*h(1)*(2*h(2)+h(3)))))/(60*h(1)*(h(1)+h(2))*(h(1)+h(2)+h(3)))

        (H*(12*H^3+30*h(1)*(h(1)+h(2))*(h(1)+h(2)+h(3))+ ...
        15*H^2*(3*h(1)+2*h(2)+h(3))+20*H*(3*h(1)^2+h(2)*(h(2)+h(3))+ ...
        2*h(1)*(2*h(2)+h(3)))))/(60*(H+h(1))*(H+h(1)+h(2))* ...
        (H+h(1)+h(2)+h(3)))

        ];

        err=[

        (1/7200)*(H^2*(10*H^4+30*h(1)*(h(1)+h(2))* ...
        (h(1)+h(2)+h(3))*(h(1)+h(2)+h(3)+h(4))+ ...
        12*H^3*(4*h(1)+3*h(2)+2*h(3)+h(4))+ ...
        15*H^2*(6*h(1)^2+3*h(2)^2+h(3)*(h(3)+h(4))+ ...
        2*h(2)*(2*h(3)+h(4))+3*h(1)*(3*h(2)+2*h(3)+ ...
        h(4)))+20*H*(4*h(1)^3+h(2)*(h(2)+h(3))* ...
        (h(2)+h(3)+h(4))+3*h(1)^2*(3*h(2)+2*h(3)+ ...
        h(4))+2*h(1)*(3*h(2)^2+h(3)*(h(3)+h(4))+ ...
        2*h(2)*(2*h(3)+h(4))))))

        
        -((1/7200)*(H^3*(2*H^3+10*h(1)*(h(1)+h(2))* ...
        (h(1)+h(2)+h(3))+3*H^2*(3*h(1)+2*h(2)+ ...
        h(3))+5*H*(3*h(1)^2+h(2)*(h(2)+h(3))+ ...
        2*h(1)*(2*h(2)+h(3))))))

        ];

    elseif ord==6

        pbeta=[
        
        -((H^2*(10*H^4+30*h(1)*(h(1)+h(2))*(h(1)+h(2)+h(3))* ...
        (h(1)+h(2)+h(3)+h(4))+12*H^3*(4*h(1)+3*h(2)+2*h(3)+h(4))+ ...
        15*H^2*(6*h(1)^2+3*h(2)^2+h(3)*(h(3)+h(4))+2*h(2)*(2*h(3)+h(4))+ ...
        3*h(1)*(3*h(2)+2*h(3)+h(4)))+ ...
        20*H*(4*h(1)^3+h(2)*(h(2)+h(3))*(h(2)+h(3)+h(4))+ ...
        3*h(1)^2*(3*h(2)+2*h(3)+h(4))+2*h(1)*(3*h(2)^2+h(3)*(h(3)+h(4))+ ...
        2*h(2)*(2*h(3)+h(4))))))/(60*h(5)*(h(4)+h(5))*(h(3)+h(4)+h(5))* ...
        (h(2)+h(3)+h(4)+h(5))*(h(1)+h(2)+h(3)+h(4)+h(5))))

        (H^2*(10*H^4+30*h(1)*(h(1)+h(2))*(h(1)+h(2)+h(3))* ...
        (h(1)+h(2)+h(3)+h(4)+h(5))+12*H^3*(4*h(1)+3*h(2)+2*h(3)+h(4)+ ...
        h(5))+15*H^2*(6*h(1)^2+3*h(2)^2+h(3)*(h(3)+h(4)+h(5))+ ...
        2*h(2)*(2*h(3)+h(4)+h(5))+3*h(1)*(3*h(2)+2*h(3)+h(4)+h(5)))+ ...
        20*H*(4*h(1)^3+h(2)*(h(2)+h(3))*(h(2)+h(3)+h(4)+h(5))+ ...
        3*h(1)^2*(3*h(2)+2*h(3)+h(4)+h(5))+ ...
        2*h(1)*(3*h(2)^2+h(3)*(h(3)+h(4)+h(5))+2*h(2)*(2*h(3)+h(4)+h(5))))))/ ...
