        (h(1)+h(2)+h(3)+h(4)+h(5))+12*H^3*(4*h(1)+3*h(2)+ ...
        2*(h(3)+h(4))+h(5))+15*H^2*(6*h(1)^2+3*h(2)^2+ ...
        (h(3)+h(4))*(h(3)+h(4)+h(5))+2*h(2)*(2*(h(3)+h(4))+h(5))+ ...
