        20*H*(4*h(1)^3+h(2)*(h(2)+h(3)+h(4))*(h(2)+h(3)+h(4)+h(5))+ ...
        3*h(1)^2*(3*h(2)+2*(h(3)+h(4))+h(5))+ ...
        2*h(1)*(3*h(2)^2+(h(3)+h(4))*(h(3)+h(4)+h(5))+ ...
        2*h(2)*(2*(h(3)+h(4))+h(5))))))/(60*h(3)*(h(2)+h(3))* ...
        (h(1)+h(2)+h(3))*h(4)*(h(4)+h(5))))


        (H^2*(10*H^4+30*h(1)*(h(1)+h(2)+h(3))*(h(1)+h(2)+h(3)+h(4))* ...
        (h(1)+h(2)+h(3)+h(4)+h(5))+12*H^3*(4*h(1)+3*h(2)+3*h(3)+ ...
