        3*h(1)*(6*h(2)^2+3*h(3)^2+h(4)*(h(4)+h(5))+2*h(3)*(2*h(4)+h(5))+ ...
        3*h(2)*(3*h(3)+2*h(4)+h(5))))+ ...
